import axios from 'axios';

export const initUrl = 'https://rickandmortyapi.com/api/character';



export const fetchAPI = async (page = 0, filter) => {
  let url = `${initUrl}?name=${filter}?page=${page}`;

  if (filter) {
    console.log(response)
  }else response = await axios.get(`${initUrl}?page=${page}`);
  const { data } = response;
  response = await axios.get(url);
  return data;
};
